import React, { useState } from "react";

const Counter = () => {
  // let counter= 0;
  const [counter, setCounter] = useState(0);
  const increase = () => {
    setCounter(counter + 1);
  };
  const decrease = () => {
    setCounter(counter - 1);
  };
  return (
    <div
      style={{
        background: "red",
      }}
    >
      <h1>{counter}</h1>
      <button onClick={decrease}>-</button>
      <button onClick={increase}>+</button>
    </div>
  );
};

export default Counter;
